import React from 'react';
import MenuItem from './menu-item.component';

const Directory = (props) => {
  return (
    <div>
      {props.directory.map(({ id, ...otherSectionProps }) => (
        <MenuItem key={id} {...otherSectionProps} />
      ))}
    </div>
  );
};
export default Directory;
